import React from "react";
//import './ImgLinkForm.css';

const FaceRecognition = (imgUrl) => {
    let a = imgUrl;
    let b = imgUrl.toString();
    return (
        <div className="center" style={{marginTop: "5px", marginBottom: "5px", width: "470px", height: "auto"}}>
            <img alt="" src={imgUrl}/>
            {console.log("a ",a)}
            {console.log("b ", b)}
        </div>
    );
}

export default FaceRecognition;
